import React from 'react';

const ProductoItem = (props)=>{
    const {descripcion, precio,cantidad,imagen,body} = props;
    return(
        <div className="producto">
            <h1>{descripcion}</h1>
            <h2>{precio}</h2>
            <h3>{cantidad}</h3>
            <img src={imagen}/>
            <div dangerouslySetInnerHTML={{__html:body}} />
            <hr/>
        </div>
    );
}

export default ProductoItem;
